script: |
  super -f text -I q6256.spq | sort > q6256.out

inputs:
  - name: q6256.spq
    data: |
      SELECT + col0 * 90 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN NULL AND - col0 AND - ( + + col0 ) + - col2 >= col1;
  - name: tab0

outputs:
  - name: q6256.out
    data: |
